import React, {useState} from 'react';
import Axios from'axios';
import '../App.css'
import './patient.css'

function Admin() {

    const[list, setList]=useState([])
    const [administrator_signin,setadministrator_signin]=useState( )
    const [name,setname]=useState('')
    const [contact,setcontact]=useState( )
    
    const getData = () => {
        Axios.post('http://localhost:3001/admin_details').then(res => {
            setList(res.data)
        })
    }
    
    getData()

    return(
      <div >
        <div className='patients' style={{marginLeft: '100px', height:'20vh'}}>
        <h1>List of Administrators</h1>
        </div>  
        <table id = 'patients' style={{alignItems: 'center',
            justifyContent: 'center', display: 'flex', height:'90vh', marginLeft: '160px',
            borderCollapse: 'separate', borderSpacing: '0 15px'}}>
      {/* <thead>
      <th>userName</th><th>password</th><th>status</th><th>&nbsp;</th>
      </thead> */}
      <tbody>
      {list.map((val,key)=>{
        return(
          <tr style={{boxShadow: '10px 10px 5px grey', backgroundColor: '#c4d8e2',
          border:'5px', borderSpacing: '0 15px', width: '150px', textAlign:'center'}}>
            <td>{val.administrator_signin}
            </td>
            <td>{val.name}
            </td>
            <td>{val.contact}
            </td>
            <td>
            <div className="button">
                  <button className="btn btn-primary btn-block" type="submit" style={{ backgroundColor: '#0072c6', color: 'white'}}>Delete</button>
                </div>
            </td>
            <td>
            <div className="button">
                  <button className="btn btn-primary btn-block" type="submit" style={{ backgroundColor: '#0072c6', color: 'white'}}>Update</button>
                </div>
            </td>
          </tr>
        )
      })}
      </tbody>
    </table>
    
        </div>
    )

}
export default Admin;
